INSERT INTO `announcements` VALUES (3,'Velkommen til Datingportalen.com','Vi regner med og håber på,\r\n\r\nMed venlig hilsen\r\nDatingportalen.com\r\nOne site - fits all',1,'2019-05-10 10:56:43','2020-06-20 10:35:25'),(4,'Velkommen til Datingportalen.com','Vi er super glade for at du har lyst til at prøve vores helt nye side ud, og håber selvfølgelig at du kan li’ hvad vi har knoklet på de sidste 8 måneder.\r\n\r\nTjek endelig siden og nogle af de nye funktioner ud, såsom favorit indbakken, hoover menuen når du fører musen over et profilnavn i en af dine indbakker, smid en fremhævning op for at blive set på forsiden med et billede og tekst efter dit valg, eller brug en rund 5-krone på at blive smidt øverst i indbakken hos en person du finder ekstra spændende og gerne vil i kontakt med.\r\n\r\nHvis du har spørgsmål har vi en meget udførlig FAQ hvor du vil kunne finde svar på det meste, og tøv ikke med at skrive til support@datingportalen.com hvis du ikke kan finde svar derinde.\r\n\r\nVi håber du har lyst til at være med på vores rejse til at blive Danmark’s bedste datingside :)\r\n\r\nVenligste hilsner\r\nTeam Datingportalen\r\nOne site - fits all',3,'2019-05-10 10:56:54','2020-06-20 10:35:25'),(8,'Stay tuned for more :)','Vi har sat ambitionerne højt her hos Datingportalen i vores mål til at blive Danmarks bedste datingsite. Vi mener at vi hele tiden skal være i udvikling, lytte til vores brugere, og implementere nye funktioner jævnligt for at være konkurrencedygtige, og give dig som bruger, lyst til at være herinde.\r\n\r\nEt par ting du har i vente som bruger:\r\n- Fælles chat hvor du kan chatte på kryds af portalerne.\r\n- Der vil blive implementeret en ny webcam funktion, hvor du kan sidde på cam både for alle at se på den pågældende portal, men også en mindre gruppechat, og selvfølgelig 1 til 1 chat, hvor du kan se og sludre lidt med din kommende date.\r\n- Du vil også få mulighed for at verificere din profil med NemID, din og andres sikkerhed for at du er seriøs.\r\n- Funktionen \"Negative matchord\" vil gå live, som gør det markant nemmere for dig som bruger at sortere i din indbakke.\r\n\r\nVi regner med og håber på, at du har lyst til at være på vores rejse til at gøre online dating sjovere og nemmere for dig som bruger :)\r\n\r\nMed venlig hilsen\r\nDatingportalen.com\r\nOne site - fits all',1,'2019-05-15 18:06:24','2020-06-20 10:35:25'),(9,'Stay tuned for more :)','Vi har sat ambitionerne højt her hos Datingportalen i vores mål til at blive Danmarks bedste datingsite. Vi mener at vi hele tiden skal være i udvikling, lytte til vores brugere, og implementere nye funktioner jævnligt for at være konkurrencedygtige, og give dig som bruger, lyst til at være herinde.\r\n\r\nEt par ting du har i vente som bruger:\r\n- Fælles chat hvor du kan chatte på kryds af portalerne.\r\n- Der vil blive implementeret en ny webcam funktion, hvor du kan sidde på cam både for alle at se på den pågældende portal, men også en mindre gruppechat, og selvfølgelig 1 til 1 chat, hvor du kan se og sludre lidt med din kommende date.\r\n- Du vil også få mulighed for at verificere din profil med NemID, din og andres sikkerhed for at du er seriøs.\r\n- Funktionen \"Negative matchord\" vil gå live, som gør det markant nemmere for dig som bruger at sortere i din indbakke.\r\n\r\nVi regner med og håber på, at du har lyst til at være på vores rejse til at gøre online dating sjovere og nemmere for dig som bruger :)\r\n\r\nMed venlig hilsen\r\nDatingportalen.com\r\nOne site - fits all',2,'2019-05-15 18:06:34','2020-06-20 10:35:25'),(10,'Stay tuned for more :)','Vi har sat ambitionerne højt her hos Datingportalen i vores mål til at blive Danmarks bedste datingsite. Vi mener at vi hele tiden skal være i udvikling, lytte til vores brugere, og implementere nye funktioner jævnligt for at være konkurrencedygtige, og give dig som bruger, lyst til at være herinde.\r\n\r\nEt par ting du har i vente som bruger:\r\n- Fælles chat hvor du kan chatte på kryds af portal