INSERT INTO `events` VALUES (1,71,'Why do we use it?','1',1500,'0','2020-06-11','23:06','London','<p><span style=\"color: rgb(0, 0, 0);\">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots </span><span style=\"color: rgb(255, 153, 0);\">in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, </span><strong style=\"color: rgb(255, 153, 0);\">from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. </strong><strong style=\"color: rgb(0, 0, 0);\">Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The</strong></p><p><br></p><p><strong style=\"color: rgb(0, 0, 0);\">﻿ Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on t</strong><span style=\"color: rgb(0, 0, 0);\">he theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</span></p>','uploads/event/5ee808f987104_2020-06-16.jpg',9,0,'2020-06-15 13:04:12','2020-06-15 20:08:00'),(2,71,'Where can I get some?','1',1500,'1','2020-06-20','01:05','London','Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.','uploads/event/5ee7c57237eac_2020-06-15.jpg',9,1,'2020-06-15 15:01:06','2020-06-15 15:01:06');
